import React from 'react';

import './Login.css';

const Login = () => {
    return (
        <div className="login">
            <div className="login__form">
                <img src="" alt="Infostud logo" />
                <label for="email">Email</label>
                <input type="email" id="email" />
            </div>
        </div>
    )
}

export default Login
